import { httpService } from "./";
import { apiUrl } from "../config";

const checkInvitationTokenValidityRequest = (params) => {
    return httpService.post(`${apiUrl}/users/checkInvitationTokenValidity`, params);
}

const registerByPhoneRequest = (params) => {
    return httpService.post(`${apiUrl}/users/byPhone`, params);
}

const registerByEmailRequest = (params) => {
    return httpService.post(`${apiUrl}/users`, params);
}

const registerByShareableLinkRequest = (params) => {
    return httpService.post(`${apiUrl}/users/unverified`, params);
}

const verfiyAccountRequest = (params) => {
    return httpService.post(`${apiUrl}/users/submitOTP`, params);
}

const resendOTBRequest = (params) => {
    // params: phone and service
    return httpService.post(`${apiUrl}/users/resendOTP`, params);
}

export {
    checkInvitationTokenValidityRequest,
    registerByPhoneRequest,
    registerByEmailRequest,
    registerByShareableLinkRequest,
    verfiyAccountRequest,
    resendOTBRequest
}
